class Solution:
    def processStr(self, s: str) -> str:
        res = []
        for ch in s:
            if 'a' <= ch <= 'z':
                res.append(ch)
            elif ch == '*':
                if res:
                    res.pop()
            elif ch == '#':
                # duplicate the current result
                res = res + res
            elif ch == '%':
                # reverse the current result
                res.reverse()
        return ''.join(res)

